import React, { useEffect, useState } from "react";
import { getWisata, deleteWisata } from "../../api";
import { Link } from "react-router-dom";

const ManajemenWisata = () => {
    const [wisataList, setWisataList] = useState([]);

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = async () => {
        const data = await getWisata();
        setWisataList(data);
    };

    const handleDelete = async (id) => {
        if (window.confirm("Apakah anda yakin ingin menghapus destinasi ini?")) {
            await deleteWisata(id);
            fetchData();
        }
    };

    return (
        <div className="admin-page">
            <h2>Manajemen Wisata</h2>
            <Link to="/admin/tambah-wisata">+ Tambah Wisata</Link>
            <table>
                <thead>
                    <tr>
                        <th>#</th>
                        <th>Nama</th>
                        <th>Aksi</th>
                    </tr>
                </thead>
                <tbody>
                    {wisataList.map((wisata, index) => (
                        <tr key={wisata.id}>
                            <td>{index + 1}</td>
                            <td>{wisata.nama}</td>
                            <td>
                                <Link to={`/admin/edit-wisata/${wisata.id}`}>Edit</Link>
                                <button onClick={() => handleDelete(wisata.id)}>Hapus</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default ManajemenWisata;
